import React from "react";
import List from "./List";

const Birthday = () => {
  return (
    <div className="bg-pink-500 w-full h-screen">
      <div className="bg-white w-[300px] h-[500px] flex justify-center items-center ">
        <h3>0 Birthday today</h3>
        <List />
      </div>
    </div>
  );
};

export default Birthday;
